import React from 'react'
import Link from 'next/link'
import Nav from './Nav'
import styled from 'styled-components';

const Logo = styled.h1`
    background: red;

`;

const Header = () => {
    return (
        <header>

            <div className="bar">
            <Logo>
                <Link href="/">Sick Fits</Link>  
                </Logo>
            </div>
            <div className="sub-bar">
                <p>Search</p>
            </div>
            <Nav></Nav>
        </header>
    )

}

export default Header
